ndler","-- so caching them is worth the effort","local tinsert = table.insert","local ssub, slen, schar, sbyte, sformat, sgsub = string.sub, string.len, string.char, string.byte, string.format, string.gsub","local split = api.split","local jsonParse, jsonStringify = luci.jsonc.parse, luci.jsonc.stringify","local base64Decode = api.base64Decode","local uci = luci.model.uci.cursor()","uci:revert(appname)","","local has_ss = api.is_finded(\"ss-redir\")","local has_ss_rust = api.is_finded(\"sslocal\")","local has_trojan_plus = api.is_finded(\"trojan-plus\")","local has_singbox = api.finded_com(\"singbox\")","local has_xray = api.finded_com(\"xray\")","local has_trojan_go = api.finded_com(\"trojan-go\")","local has_hysteria2 = api.finded_com(\"hysteria\")","local allowInsecure_default = nil","local ss_aead_type_default = uci:get(appname, \"@global_subscribe[0]\", \"ss_aead_type\") or \"shadowsocks-libev\"","local trojan_type_default = uci:get(appname, \"@global_subscribe[0]\", \"trojan_type\") or \"trojan-plus\"","local vmess_type_default = uci:get(appname, \"@global_subscribe[0]\", \"vmess_type\") or \"xray\"","local vless_type_default = uci:get(appname, \"@global_subscribe[0]\", \"vless_type\") or \"xray\"","local hysteria2_type_default = uci:get(appname, \"@global_subscribe[0]\", \"hysteria2_type\") or \"hysteria2\"","-- 判断是否过滤节点关键字","local filter_keyword_mode_default = uci:get(appname, \"@global_subscribe[0]\", \"filter_keyword_mode\") or \"0\"","local filter_keyword_discard_list_default = uci:get(appname, \"@global_subscribe[0]\", \"filter_discard_list\") or {}","local filter_keyword_keep_list_default = uci:get(appname, \"@global_subscribe[0]\", \"filter_keep_list\") or {}","local function is_filter_keyword(value)","\tif filter_keyword_mode_default == \"1\" then","\t\tfor k,v in ipairs(filter_keyword_discard_list_default) do","\t\t\tif value:find(v, 1, true) then","\t\t\t\treturn true","\t\t\tend","\t\tend","\telseif filter_keyword_mode_default == \"2\" then","\t\tlocal result = true","\t\tfor k,v in ipairs(filter_keyword_keep_list_default) do","\t\t\tif value:find(v, 1, true) then","\t\t\t\tresult = false","\t\t\tend","\t\tend","\t\treturn result","\telseif filter_keyword_mode_default == \"3\" then","\t\tlocal result = false","\t\tfor k,v in ipairs(filter_keyword_discard_list_default) do","\t\t\tif value:find(v, 1, true) then","\t\t\t\tresult = true","\t\t\tend","\t\tend","\t\tfor k,v in ipairs(filter_keyword_keep_list_default) do","\t\t\tif value:find(v, 1, true) then","\t\t\t\tresult = false","\t\t\tend","\t\tend","\t\treturn result","\telseif filter_keyword_mode_default == \"4\" then","\t\tlocal result = true","\t\tfor k,v in ipairs(filter_keyword_keep_list_default) do","\t\t\tif value:find(v, 1, true) then","\t\t\t\tresult = false","\t\t\tend","\t\tend","\t\tfor k,v in ipairs(filter_keyword_discard_list_default) do","\t\t\tif value:find(v, 1, true) then","\t\t\t\tresult = true","\t\t\tend","\t\tend","\t\treturn result","\tend","\treturn false","end","","local nodeResult = {} -- update result","local debug = false","","local log = function(...)","\tif debug == true then","\t\tlocal result = os.date(\"%Y-%m-%d %H:%M:%S: \") .. table.concat({...}, \" \")","\t\tprint(result)","\telse","\t\tapi.log(...)","\tend","end","","-- 获取各项动态配置的当前服务器，可以用 get 和 set， get必须要获取到节点表","local CONFIG = {}","do","\tlocal function import_config(protocol)","\t\tlocal name = string.upper(protocol)","\t\tlocal szType = \"@global[0]\"","\t\tlocal option = protocol .. \"_node\"","\t\t","\t\tlocal node_id = uci:get(appname, szType, option)","\t\tCONFIG[#CONFIG + 1] = {","\t\t\tlog = true,","\t\t\tremarks = name .. \"节点\",","\t\t\tcurrentNode = node_id and uci:get_all(appname, node_id) or nil,","\t\t\tset = function(o, server)","\t\t\t\tuci:set(appname, szType, option, server)","\t\t\t\to.newNodeId = server","\t\t\tend","\t\t}","\tend","\timport_config(\"tcp\")","\timport_config(\"udp\")","","\tif true then","\t\tlocal i = 0","\t\tlocal option = \"node\"","\t\tuci:foreach(appname, \"socks\", function(t)","\t\t\ti = i + 1","\t\t\tlocal node_id = t[option]","\t\t\tCONFIG[#CONFIG + 1] = {","\t\t\t\tlog = true,","\t\t\t\tid = t[\".name\"],","\t\t\t\tremarks = \"Socks节点列表[\" .. i .. \"]\",","\t\t\t\tcurrentNode = node_id and uci:get_all(appname, node_id) or nil,","\t\t\t\tset = function(o, server)","\t\t\t\t\tuci:set(appname, t[\".name\"], option, server)","\t\t\t\t\to.newNodeId = server","\t\t\t\tend,","\t\t\t\tdelete = function(o)","\t\t\t\t\tuci:delete(appname, t[\".name\"])","\t\t\t\tend","\t\t\t}","\t\tend)","\tend","","\tif true then","\t\tlocal i = 0","\t\tlocal option = \"lbss\"","\t\tuci:foreach(appname, \"haproxy_config\", function(t)","\t\t\ti = i + 1","\t\t\tlocal node_id = t[option]","\t\t\tCONFIG[#CONFIG + 1] = {","\t\t\t\tlog = true,","\t\t\t\tid = t[\".name\"],","\t\t\t\tremarks = \"HAProxy负载均衡节点列表[\" .. i .. \"]\",","\t\t\t\tcurrentNode = node_id and uci:get_all(appname, node_id) or nil,","\t\t\t\tset = function(o, server)","\t\t\t\t\tuci:set(appname, t[\".name\"], option, server)","\t\t\t\t\to.newNodeId = server","\t\t\t\tend,","\t\t\t\tdelete = function(o)","\t\t\t\t\tuci:delete(appname, t[\".name\"])","\t\t\t\tend","\t\t\t}","\t\tend)","\tend","","\tif true then","\t\tlocal i = 0","\t\tlocal options = {\"tcp\", \"udp\"}","\t\tuci:foreach(appname, \"acl_rule\", function(t)","\t\t\ti = i + 1","\t\t\tfor index, value in ipairs(options) do","\t\t\t\tlocal option = value .. \"_node\"","\t\t\t\tlocal node_id = t[option]","\t\t\t\tCONFIG[#CONFIG + 1] = {","\t\t\t\t\tlog = true,","\t\t\t\t\tid = t[\".name\"],","\t\t\t\t\tremarks = \"访问控制列表[\" .. i .. \"]\",","\t\t\t\t\tcurrentNode = node_id and uci:get_all(appname, node_id) or nil,","\t\t\t\t\tset = function(o, server)","\t\t\t\t\t\tuci:set(appname, t[\".name\"], option, server)","\t\t\t\t\t\to.newNodeId = server","\t\t\t\t\tend","\t\t\t\t}","\t\t\tend","\t\tend)","\tend","","\tuci:foreach(appname, \"socks\", function(o)","\t\tlocal id = o[\".name\"]","\t\tlocal node_table = uci:get(appname, id, \"autoswitch_backup_node\")","\t\tif node_table then","\t\t\tlocal nodes = {}","\t\t\tlocal new_nodes = {}","\t\t\tfor k,node_id in ipairs(node_table) do","\t\t\t\tif node_id then","\t\t\t\t\tlocal currentNode = uci:get_all(appname, node_id) or nil","\t\t\t\t\tif currentNode then","\t\t\t\t\t\tif currentNode.protocol and (currentNode.protocol == \"_balancing\" or currentNode.protocol == \"_shunt\") then","\t\t\t\t\t\t\tcurrentNode = nil","\t\t\t\t\t\tend","\t\t\t\t\t\tnodes[#nodes + 1] = {","\t\t\t\t\t\t\tlog = true,","\t\t\t\t\t\t\tremarks = \"Socks[\" .. id .. \"]备用节点的列表[\" .. k .. \"]\",","\t\t\t\t\t\t\tcurrentNode = currentNode,","\t\t\t\t\t\t\tset = function(o, server)","\t\t\t\t\t\t\t\tfor kk, vv in pairs(CONFIG) do","\t\t\t\t\t\t\t\t\tif (vv.remarks == id .. \"备用节点的列表\") then","\t\t\t\t\t\t\t\t\t\ttable.insert(vv.new_nodes, server)","\t\t\t\t\t\t\t\t\tend","\t\t\t\t\t\t\t\tend","\t\t\t\t\t\t\tend","\t\t\t\t\t\t}","\t\t\t\t\tend","\t\t\t\tend","\t\t\tend","\t\t\tCONFIG[#CONFIG + 1] = {","\t\t\t\tremarks = id .. \"备用节点的列表\",","\t\t\t\tnodes = nodes,","\t\t\t\tnew_nodes = new_nodes,","\t\t\t\tset = function(o)","\t\t\t\t\tfor kk, vv in pairs(CONFIG) do","\t\t\t\t\t\tif (vv.remarks == id .. \"备用节点的列表\") then","\t\t\t\t\t\t\tuci:set_list(appname, id, \"autoswitch_backup_node\", vv.new_nodes)","\t\t\t\t\t\tend","\t\t\t\t\tend","\t\t\t\tend","\t\t\t}","\t\tend","\tend)","","\tuci:foreach(appname, \"nodes\", function(node)","\t\tif node.protocol and node.protocol == '_shunt' then","\t\t\tlocal node_id = node[\".name\"]","","\t\t\tlocal rules = {}","\t\t\tuci:foreach(appname, \"shunt_rules\", function(e)","\t\t\t\tif e[\".name\"] and e.remarks then","\t\t\t\t\ttable.insert(rules, e)","\t\t\t\tend","\t\t\tend)","\t\t\ttable.insert(rules, {","\t\t\t\t[\".name\"] = \"default_node\",","\t\t\t\tremarks = \"默认\"","\t\t\t})","\t\t\ttable.insert(rules, {","\t\t\t\t[\".name\"] = \"main_node\",","\t\t\t\tremarks = \"默认前置\"","\t\t\t})","","\t\t\tfor k, e in pairs(rules) do","\t\t\t\tlocal _node_id = node[e[\".name\"]] or nil","\t\t\t\tif _node_id and api.parseURL(_node_id) then","\t\t\t\telse","\t\t\t\t\tCONFIG[#CONFIG + 1] = {","\t\t\t\t\t\tlog = false,","\t\t\t\t\t\tcurrentNode = _node_id and uci:get_all(appname, _node_id) or nil,","\t\t\t\t\t\tremarks = \"分流\" .. e.remarks .. \"节点\",","\t\t\t\t\t\tset = function(o, server)","\t\t\t\t\t\t\tif not server then server = \"nil\" end","\t\t\t\t\t\t\tuci:set(appname, node_id, e[\".name\"], server)","\t\t\t\t\t\t\to.newNodeId = server","\t\t\t\t\t\tend","\t\t\t\t\t}","\t\t\t\tend","\t\t\tend","\t\telseif node.protocol and node.protocol == '_balancing' then","\t\t\tlocal node_id = node[\".name\"]","\t\t\tlocal nodes = {}","\t\t\tlocal new_nodes = {}","\t\t\tif node.balancing_node then","\t\t\t\tfor k, node in pairs(node.balancing_node) do","\t\t\t\t\tnodes[#nodes + 1] = {","\t\t\t\t\t\tlog = false,","\t\t\t\t\t\tnode = node,","\t\t\t\t\t\tcurrentNode = node and uci:get_all(appname, node) or nil,","\t\t\t\t\t\tremarks = node,","\t\t\t\t\t\tset = function(o, server)","\t\t\t\t\t\t\tfor kk, vv in pairs(CONFIG) do","\t\t\t\t\t\t\t\tif (vv.remarks == \"负载均衡节点列表\" .. node_id) then","\t\t\t\t\t\t\t\t\ttable.insert(vv.new_nodes, server)","\t\t\t\t\t\t\t\tend","\t\t\t\t\t\t\tend","\t\t\t\t\t\tend","\t\t\t\t\t}","\t\t\t\tend","\t\t\tend","\t\t\tCONFIG[#CONFIG + 1] = {","\t\t\t\tremarks = \"负载均衡节点列表\" .. node_id,","\t\t\t\tnodes = nodes,","\t\t\t\tnew_nodes = new_nodes,","\t\t\t\tset = function(o)","\t\t\t\t\tfor kk, vv in pairs(CONFIG) do","\t\t\t\t\t\tif (vv.remarks == \"负载均衡节点列表\" .. node_id) then","\t\t\t\t\t\t\t--log(\"刷新负载均衡节点列表\")","\t\t\t\t\t\t\tuci:foreach(appname, \"nodes\", function(node2)","\t\t\t\t\t\t\t\tif node2[\".name\"] == node[\".name\"] then","\t\t\t\t\t\t\t\t\tlocal section = uci:section(appname, \"nodes\", node_id)","\t\t\t\t\t\t\t\t\tuci:set_list(appname, section, \"balancing_node\", vv.new_nodes)","\t\t\t\t\t\t\t\tend","\t\t\t\t\t\t\tend)","\t\